import React from 'react';
import TransactionForm from './transactionForm';

const user = ({ user, onLogout }) => {
  const handleTransactionSubmit = (transactionData) => {
    // Process the transaction data here, such as sending it to a server or updating the state
    console.log('Transaction submitted:', transactionData);
  };

  return (
    <div>
      <h2>User Page</h2>
      <p>Welcome to the user page, {user}.</p>
      <TransactionForm onTransactionSubmit={handleTransactionSubmit} />
      <button className="btn btn-secondary mt-3" onClick={onLogout}>Logout</button>
    </div>
  );
};

export default user;
